import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import Tab from 'react-bootstrap/Tab';
import Tabs from 'react-bootstrap/Tabs';import InitData from "./component/InitData";

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <React.StrictMode>
        <Tabs
            defaultActiveKey="countries"
            id="fill-tab-example"
            className="mb-3 border-primary bg-secondary"
            fill
        >
            <Tab eventKey="counries" title="Countries">
                <App/>
            </Tab>
            <Tab eventKey="ini" title="Initialize Data">
                <InitData/>
            </Tab>
        </Tabs>
    </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
